	shiroGetKeyBytes20220117 := func(key string) []byte {
		//将key进行base64解码
		keyBytes, _ := base64.StdEncoding.DecodeString(key)

		switch l := len(keyBytes); {
		case l < 16:
			keyBytes = append(keyBytes, make([]byte, 16-l)...)
		case l > 16:
			keyBytes = keyBytes[:16]
		}
		return keyBytes
	}

	shiroPKCS5Padding20220117 := func(ciphertext []byte, blockSize int) []byte {
		padding := blockSize - len(ciphertext)%blockSize
		padtext := bytes.Repeat([]byte{byte(padding)}, padding)
		return append(ciphertext, padtext...)
	}
	shiroEncrypt20220117 := func(key string, origData []byte) ([]byte, error) {
		keyBytes := shiroGetKeyBytes20220117(key)
		//
		block, err := aes.NewCipher(keyBytes)
		if err != nil {
			return nil, err
		}
		blockSize := block.BlockSize()
		origData = shiroPKCS5Padding20220117(origData, blockSize)
		blockMode := cipher.NewCBCEncrypter(block, keyBytes[:blockSize])
		crypted := make([]byte, len(origData))
		blockMode.CryptBlocks(crypted, origData)
		return append(keyBytes[:blockSize], crypted...), nil
	}

	//AES加密
	shiroAesEncrypt20220117 := func(data []byte, key string) (string, error) {
		crypt, err := shiroEncrypt20220117(key, data)
		if err != nil {
			return "", err
		}
		//base64加密
		return base64.StdEncoding.EncodeToString(crypt), nil
	}

